CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_comprar_curso` (IN `p_id_alumno` INT, IN `p_id_curso` INT, IN `p_numero_tarjeta` VARCHAR(16), IN `p_fecha_vencimiento` VARCHAR(5), IN `p_ccv` VARCHAR(3))   BEGIN
