CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_comprar_curso_paypal` (IN `p_id_alumno` INT, IN `p_id_curso` INT, IN `p_paypal_order_id` VARCHAR(50))   BEGIN
    DECLARE v_precio DECIMAL(10,2);
    DECLARE v_error INT DEFAULT 0;
    DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET v_error = 1;
    
    START TRANSACTION;
    
    -- Get course price
    SELECT precio INTO v_precio 
    FROM curso 
    WHERE id = p_id_curso AND status = 1;
    
    -- Verify course exists and is active
    IF v_precio IS NULL THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'El curso no existe o no está disponible';
    END IF;
    
    -- Verify student isn't already enrolled
    IF EXISTS (SELECT 1 FROM inscripcion WHERE id_alumno = p_id_alumno AND id_curso = p_id_curso) THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Ya estás inscrito en este curso';
    END IF;

    -- Record transaction
    INSERT INTO transaccion (
        id_alumno,
        id_curso, 
        monto,
        fecha,
        metodo_pago,
        referencia_pago,
        estatus
    ) VALUES (
        p_id_alumno,
        p_id_curso,
        v_precio,
        NOW(),
        'PayPal',
        p_paypal_order_id,
        1
    );

    -- Create enrollment
    INSERT INTO inscripcion (
        id_alumno,
        id_curso,
        fecha_inscripcion
    ) VALUES (
        p_id_alumno,
        p_id_curso,
        NOW()
    );

    -- Initialize kardex
    INSERT INTO kardex (
        id_alumno,
        id_curso,
        calificacion
    ) VALUES (
        p_id_alumno,
        p_id_curso,
        0
    );

    IF v_error = 1 THEN
        ROLLBACK;
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Error al procesar la inscripción';
    ELSE
        COMMIT;
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_consultar_usuario` (IN `p_id` INT)   BEGIN
    -- Consulta la información del usuario
    SELECT u.*, tu.descripcion AS tipo_usuario
    FROM usuario u
    JOIN tipo_usuario tu ON u.tipo_usuario = tu.id
    WHERE u.id = p_id;
    
    -- Si es un instructor, mostrar la biografía y cuenta bancaria
    IF (SELECT tipo_usuario FROM usuario WHERE id = p_id) = 2 THEN
        SELECT biografia, cuenta_bancaria
        FROM instructor
        WHERE id = p_id;
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_crear_usuario` (IN `p_nombre_usuario` VARCHAR(100), IN `p_nombre` VARCHAR(100), IN `p_apellidos` VARCHAR(100), IN `p_email` VARCHAR(100), IN `p_contrasena` VARCHAR(255), IN `p_tipo_usuario` TINYINT, IN `p_foto` BLOB, IN `p_fecha_nacimiento` DATE, IN `p_telefono` BIGINT, IN `p_biografia` TEXT, IN `p_cuenta_bancaria` VARCHAR(50))   BEGIN
    -- Validación del formato del email
    IF p_email NOT REGEXP '^[A-Za-z0-9._%+-]+@[A-Za-z0-9.-]+\\.[A-Za-z]{2,}$' THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'El formato del email no es válido';
    END IF;

IF p_contrasena NOT REGEXP '^(?=.*[a-z])(?=.*[A-Z])(?=.*\\d)(?=.*[@$!%*?&.])[A-Za-z\\d@$!%*?&.]{8,}$' THEN
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'La contraseña no cumple con los requisitos: debe tener al menos 8 caracteres, una letra mayúscula, una letra minúscula, un número y un carácter especial';
END IF;


    -- Validar si el email ya existe
    IF EXISTS (SELECT 1 FROM usuario WHERE email = p_email) THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'El email ya está en uso';
    ELSE
        -- Insertar el nuevo usuario si las validaciones son correctas
        INSERT INTO usuario (nombre_usuario, nombre, apellidos, email, contrasena, tipo_usuario, foto, fecha_nacimiento, telefono)
        VALUES (p_nombre_usuario, p_nombre, p_apellidos, p_email, p_contrasena, p_tipo_usuario, p_foto, p_fecha_nacimiento, p_telefono);

        -- Si el usuario es un instructor, insertar biografía y cuenta bancaria
        IF p_tipo_usuario = 2 THEN
            UPDATE usuario
            SET biografia = p_biografia, cuenta_bancaria = p_cuenta_bancaria
            WHERE id = LAST_INSERT_ID();
        END IF;
    END IF;
END$$

