CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_EditCurso` (IN `p_id_curso` INT, IN `p_titulo` VARCHAR(255), IN `p_descripcion` TEXT, IN `p_precio` DECIMAL(10,2), IN `p_id_categoria` INT, IN `p_foto` BLOB, IN `p_id_maestro` INT)   BEGIN
