CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_kardex_filtros` (IN `p_id_alumno` INT, IN `p_fecha_inicio` DATE, IN `p_fecha_fin` DATE, IN `p_categoria_id` INT, IN `p_activo` BOOLEAN, IN `p_completado` INT)   BEGIN
    SELECT 
        c.id as curso_id,
        c.titulo AS Nombre_de_curso,
        cat.nombre AS Categoria,
        CASE WHEN c.status = 1 THEN 'Activo' ELSE 'Inactivo' END as Curso_status,
        DATE_FORMAT(i.fecha_inscripcion, '%d/%m/%Y') as Fecha_de_inscripcion,
        DATE_FORMAT(k.fecha, '%d/%m/%Y') as Ultima_fecha,
        k.lvl_Actual AS Niveles_tomados,
        c.niveles AS Niveles_totales,
        CASE WHEN k.lvl_Actual >= c.niveles THEN 1 ELSE 0 END as Curso_terminado
    FROM inscripcion i
    JOIN curso c ON i.id_curso = c.id
    JOIN categoria cat ON c.id_categoria = cat.id
    LEFT JOIN kardex k ON k.id_curso = c.id AND k.id_alumno = i.id_alumno
    WHERE i.id_alumno = p_id_alumno
        AND (i.fecha_inscripcion >= p_fecha_inicio OR p_fecha_inicio IS NULL)
        AND (i.fecha_inscripcion <= p_fecha_fin OR p_fecha_fin IS NULL)
        AND (c.id_categoria = p_categoria_id OR p_categoria_id IS NULL)
        AND (c.status = p_activo OR p_activo IS NULL)
        AND (CASE WHEN k.lvl_Actual >= c.niveles THEN 1 ELSE 0 END = p_completado OR p_completado IS NULL)
    ORDER BY i.fecha_inscripcion DESC;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_login` (IN `p_email` VARCHAR(100), IN `p_contrasena` VARCHAR(255))   BEGIN
    DECLARE v_id INT;
    DECLARE v_tipo_usuario TINYINT;
    DECLARE v_estado TINYINT;
    DECLARE v_intentos INT;

    -- Get user info
    SELECT id, tipo_usuario, estado, intentos_fallidos 
    INTO v_id, v_tipo_usuario, v_estado, v_intentos
    FROM usuario 
    WHERE email = p_email;

    -- Check if user exists
    IF v_id IS NULL THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Email o contraseña incorrectos';
    END IF;

    -- Check if account is locked
    IF v_estado = 0 THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Cuenta bloqueada';
    END IF;

    -- Validate password
    IF p_contrasena = (SELECT contrasena FROM usuario WHERE id = v_id) THEN
        -- Correct password - reset failed attempts
        UPDATE usuario 
        SET intentos_fallidos = 0 
        WHERE id = v_id;
        
        -- Return user info
        SELECT v_id AS id, v_tipo_usuario AS tipo_usuario;
    ELSE
        -- Increment failed attempts
        SET v_intentos = v_intentos + 1;
        
        UPDATE usuario 
        SET intentos_fallidos = v_intentos,
            estado = IF(v_intentos >= 3, 0, 1)
        WHERE id = v_id;

        -- Generic error message
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Email o contraseña incorrectos';
    END IF;

END$$

