CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_registrar_inscripcion` (IN `p_id_alumno` INT, IN `p_id_curso` INT)   BEGIN
    
    IF NOT EXISTS ( 
        SELECT 1 FROM inscripcion WHERE id_alumno = p_id_alumno AND id_curso = p_id_curso
    ) AND NOT EXISTS (
        SELECT 1 FROM kardex WHERE id_alumno = p_id_alumno AND id_curso = p_id_curso
    ) AND NOT EXISTS (
        SELECT 1 FROM transaccion WHERE id_alumno = p_id_alumno AND id_curso = p_id_curso
    ) THEN
        
        INSERT INTO inscripcion (id_alumno, id_curso)
        VALUES (p_id_alumno, p_id_curso);

        
        INSERT INTO kardex (id_alumno, id_curso, calificacion)
        VALUES (p_id_alumno, p_id_curso, 0);

        
        INSERT INTO transaccion (id_alumno, id_curso, monto, estatus)
        VALUES (p_id_alumno, p_id_curso, (SELECT precio FROM curso WHERE id = p_id_curso), 1);
    ELSE
        -- Si ya hay registros de ese alumno con ese curso muestra esto (No debe de aparecer) 
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Alumno ya tiene este curso';
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_reporteUser` (IN `p_Vista` INT)   BEGIN
    IF p_Vista = 1 THEN
    
        SELECT V.ID,
			V.intentos,
            V.estado,
            V.Nombre,
            V.Fecha_ingreso,
            V.Cursos_inscritos,
            V.Porcentaje_terminados
        FROM vista_AlumnoRpt V  -- SELECT *  FROM vista_AlumnoRpt V 
        WHERE V.estado = 1
        ORDER BY V.ID;
        
    ELSEIF p_Vista = 2 THEN
    
        SELECT  V.ID,
				V.intentos,
				V.estado,
				V.Nombre,
				V.Fecha_ingreso,
				V.Cursos_totales,
				V.Ganancias
        FROM vista_InstructorRpt V
        WHERE V.estado = 1
        ORDER BY V.ID;
        
    ELSE
        SELECT 'Error en procedure' AS error;
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_resumen_curso` (IN `p_id_usuario` INT, IN `p_fecha_inicio` DATE, IN `p_fecha_fin` DATE, IN `p_categoria_id` INT, IN `p_activo` BOOLEAN)   BEGIN
    SELECT V.ID_Curso, -- Num
           V.id_maestro, -- 
           V.Nombre, -- Nombre
           V.Curso_st,
           V.Fecha_creacion, -- Fecha creacion
           V.Categoria_ID,
           V.Categoria, -- Categoria
           V.Alumnos_inscritos, -- Alumnos Inscritos 
           V.Ingresos_totales -- Ingresos totales
    FROM vista_ResumenCurso V
    WHERE (V.Fecha_creacion >= p_fecha_inicio OR p_fecha_inicio IS NULL)
      AND (V.Fecha_creacion <= p_fecha_fin OR p_fecha_fin IS NULL)
      AND (V.Categoria_ID = p_categoria_id OR p_categoria_id = 0 OR p_categoria_id IS NULL)
      AND (V.Curso_st = p_activo OR p_activo IS NULL)
      AND (V.id_maestro = p_id_usuario OR p_id_usuario IS NULL OR p_id_usuario = 0)
    ORDER BY V.ID_Curso;

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_soft_delete_curso` (IN `p_id_curso` INT, IN `p_id_profesor` INT)   BEGIN
    -- Verify the course exists and belongs to the professor
    IF EXISTS (SELECT 1 FROM curso WHERE id = p_id_curso AND id_maestro = p_id_profesor) THEN
        UPDATE curso 
        SET status = 0 
        WHERE id = p_id_curso AND id_maestro = p_id_profesor;
        SELECT TRUE as success, 'Curso desactivado exitosamente' as message;
    ELSE
        SELECT FALSE as success, 'No se encontró el curso o no tienes permiso para eliminarlo' as message;
    END IF;
END$$

