CREATE DEFINER=`root`@`localhost` FUNCTION `validate_email` (`pemail` VARCHAR(255)) RETURNS VARCHAR(255) CHARSET utf8mb4 COLLATE utf8mb4_general_ci DETERMINISTIC BEGIN
    IF pemail NOT REGEXP '^[A-Za-z0-9.%+-]+@[A-Za-z0-9.-]+\.[A-Za-z]{2,}$' THEN
        RETURN 'El formato del email no es válido';
    END IF;
    RETURN 'Valid email';
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `validate_password` (`p_contrasena` VARCHAR(255)) RETURNS VARCHAR(255) CHARSET utf8mb4 COLLATE utf8mb4_general_ci DETERMINISTIC BEGIN
    IF p_contrasena NOT REGEXP '^(?=.*[a-z])(?=.*[A-Z])(?=.*\d)(?=.*[@$!%?&.])[A-Za-z\d@$!%?&.]{8,}$' THEN
        RETURN 'La contraseña no cumple con los requisitos: debe tener al menos 8 caracteres, una letra mayúscula, una letra minúscula, un número y un carácter especial';
    END IF;
    RETURN 'Valid password';
END$$

